import React,{Component} from 'react';

import { BrowserRouter as Router} from 'react-router-dom';

import BaseRouter from './routes';

import SideMenu from './components/Layout/SideMenu';

class App extends Component {
        render() {
                return (
                        <div>
                        <Router>
                          <SideMenu {...this.props}>
                              <BaseRouter />
                          </SideMenu>
                        </Router>
                      </div>
                );
              }
}

export default App;
